-- ----------------------------
--  Table structure for `demand`
-- ----------------------------
DROP TABLE IF EXISTS `demand`;
CREATE TABLE `demand` (
  `id` bigint(10) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `title` varchar(100) NOT NULL COMMENT '标题',
  `view` mediumint(20) DEFAULT '0' COMMENT '查看次数',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `price` decimal(10,0) NOT NULL DEFAULT '0' COMMENT '价格',
  `unit` varchar(20) NOT NULL DEFAULT '' COMMENT '单位',
  `number` int(10) NOT NULL DEFAULT '1000' COMMENT '数量',
  `buy_or_sale` smallint(1) NOT NULL DEFAULT '1' COMMENT '供求标识(供1 求2)',
  `area` int(3) DEFAULT NULL COMMENT '地区',
  `area_title` varchar(20) DEFAULT '' COMMENT '区名',
  `category_id` int(11) NOT NULL COMMENT '分类编号',
  `category_name` varchar(200) DEFAULT NULL COMMENT '分类英文名',
  `category_title` varchar(200) DEFAULT NULL COMMENT '类名',
  `group_id` int(10) DEFAULT NULL COMMENT '组编号',
  `group_title` varchar(100) DEFAULT '' COMMENT '组名',
  `address` varchar(255) NOT NULL DEFAULT '' COMMENT '地址',
  `parse_content` text NOT NULL COMMENT '内容',
  `uid` int(20) NOT NULL,
  `pos` smallint(1) NOT NULL DEFAULT '0' COMMENT '推荐',
  `flag` mediumint(1) NOT NULL DEFAULT '1' COMMENT '状态(1为正常  0为下架)',
  `sort` bigint(10) NOT NULL DEFAULT '999' COMMENT '排序',
  `tags` varchar(255) NOT NULL COMMENT '标签',
  PRIMARY KEY (`id`),
  KEY `uid` (`uid`),
  KEY `buy_or_sale` (`buy_or_sale`),
  KEY `area` (`area`),
  KEY `group_id` (`group_id`),
  KEY `tag` (`tags`),
  KEY `title` (`title`),
  KEY `category_id` (`category_id`),
  CONSTRAINT `demand_ibfk_1` FOREIGN KEY (`category_id`) REFERENCES `demand_category` (`id`),
  CONSTRAINT `demand_ibfk_2` FOREIGN KEY (`group_id`) REFERENCES `demand_group` (`id`),
  CONSTRAINT `demand_ibfk_3` FOREIGN KEY (`uid`) REFERENCES `user_account` (`uid`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;
delimiter ;;
CREATE TRIGGER `dmand_insert_trigger` AFTER INSERT ON `demand` FOR EACH ROW BEGIN
SELECT demand_count into @demand_count from user_evendata where user_evendata.uid = new.uid;
set @demand_count = @demand_count + 1;
UPDATE user_evendata SET user_evendata.demand_count=@demand_count where user_evendata.uid=new.uid;
END;
 ;;
delimiter ;
delimiter ;;
CREATE TRIGGER `demand_delete_trigger` AFTER DELETE ON `demand` FOR EACH ROW BEGIN
SELECT demand_count into @demand_count from user_evendata where user_evendata.uid = old.uid;
set @demand_count = @demand_count - 1;
if @demand_count < 1  THEN
UPDATE user_evendata SET user_evendata.demand_count=0 where user_evendata.uid=old.uid;
ELSE
UPDATE user_evendata SET user_evendata.demand_count=@demand_count where user_evendata.uid=old.uid;
end if;
END;
 ;;
delimiter ;

