BEGIN;
INSERT INTO `dynamic` VALUES ('1', '测试', '现在集装箱底板占的分量越来越重，很多地板厂家都有自己的独特设计，但是大多数都离不开以下几个方面， 它是有规律可循的。<br \\/>①在静态条件下，底板按相当于最大装载量P的均布载荷进行设计，并考虑5%装载偏心出现的可能性。<br \\/> ②在吊装作业中可能出现的竖向重力加速度按2g考虑。因此，箱底板应当能够承受相当于2（R-T）的载荷；<br \\/> ③能够与箱体的有关杆件连成整体，使整箱有足够的强度和刚度；<br \\/>④ 为使箱内货物的位置有一定的稳定性，底板表面与货物外包装之间要有适当的摩擦力；<br \\/> ⑤ 应使底板具有适当的吸潮功能，减少表面水分的蒸发，达到在一定程度上减弱货物包装表面的结露现象；<br \\/> ⑥具有适当的韧性，能够在一定程度上吸收外来的震动和冲击力。<br \\/><br \\/>本文摘自广州悦田集装箱配件有限公司的文章（020-80542310）', '2016-12-16 11:29:11', '1', '1', '0'), ('2', '情况且', '<p>兀囡囡</p>\n', '0000-00-00 00:00:00', '1', '1', '0'), ('3', '乚乀乃', '丁香蕉肉<p align=\"center\"><img src=\"/20161215/1744441740174440p-cf9e0afb.jpg\" class=\"fresco\" alt=\"\"/></p>', '2016-12-16 15:07:31', '0', '1', '0');
COMMIT;

-- ----------------------------
--  Table structure for `news`
-- ----------------------------
DROP TABLE IF EXISTS `news`;
CREATE TABLE `news` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `title` varchar(255) NOT NULL COMMENT '标题',
  `description` varchar(255) DEFAULT NULL COMMENT '来源',
  `category` int(11) NOT NULL COMMENT '分类',
  `tags` varchar(255) NOT NULL COMMENT '标签',
  `cover_id` int(11) DEFAULT NULL COMMENT '封面编号',
  `cover_thumb_url` varchar(255) DEFAULT NULL COMMENT '封面地址',
  `parse_content` text NOT NULL COMMENT '内容',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '发布时间',
  `view` int(11) NOT NULL DEFAULT '0' COMMENT '浏览数',
  `uid` int(11) DEFAULT NULL COMMENT '发布者',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `flag` smallint(1) NOT NULL DEFAULT '1' COMMENT '是否可用',
  `pos` smallint(1) NOT NULL DEFAULT '0' COMMENT '推荐',
  PRIMARY KEY (`id`),
  KEY `title` (`title`),
  KEY `category` (`category`),
  KEY `tags` (`tags`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='新闻';

