INSERT INTO `news` VALUES ('1', '这是个测试新闻', '点木通', '1', '红木', null, '/20161214/1403031417140317IMG_3906.jpg', '<h2><a href=\"http://suoys.blog.163.com/blog/static/12747190920110170143632/\" target=\"_blank\">原帖地址</a></h2>\n\n<p>灵活的调用方式&mdash;&mdash;JS代码调用：</p>\n\n<p><img alt=\"\" src=\"http://static.testwoodt.com/20161209/1937371937193737拍摄.png\" style=\"height:947px; width:375px\" /></p>\n\n<p><strong>[html]</strong>&nbsp;<a href=\"http://blog.csdn.net/caixiexin/article/details/6649064#\" onclick=\"dp.sh.Toolbar.Command(\'ViewSource\',this);return false;\">view plain</a>&nbsp;<a href=\"http://blog.csdn.net/caixiexin/article/details/6649064#\" onclick=\"dp.sh.Toolbar.Command(\'CopyToClipboard\',this);return false;\">copy</a></p>\n\n<ol>\n	<li>&lt;span&nbsp;style=&quot;font-size:16px;&quot;&gt;&lt;script&nbsp;type=&quot;text/javascript&quot;&nbsp;src=&quot;../../ckeditor/ckeditor.js&quot;&gt;&lt;/script&gt;&nbsp;&lt;!--此行为导入ckeditor.js文件，要注意目录是否正确。--&gt;&nbsp;&nbsp;</li>\n	<li>&nbsp;&nbsp;</li>\n	<li>&lt;textarea&nbsp;cols=&quot;80&quot;&nbsp;id=&quot;editor1&quot;&nbsp;name=&quot;editor1&quot;&nbsp;rows=&quot;10&quot;&gt;&lt;/textarea&gt;&nbsp;&nbsp;</li>\n	<li>&nbsp;&nbsp;</li>\n	<li>&lt;script&nbsp;type=&quot;text/javascript&quot;&gt;&lt;span&nbsp;style=&quot;color:#ff0000;&quot;&gt;&nbsp;CKEDITOR.replace(&nbsp;&#39;editor1&#39;&nbsp;);&lt;/span&gt;&nbsp;&lt;!--此行就是用ckeditor替换文本域textarea&nbsp;这里editor1可以是文本域的id或者name--&gt;&lt;/script&gt;&nbsp;&nbsp;</li>\n	<li>&lt;/span&gt;&nbsp;&nbsp;</li>\n</ol>\n\n<p><br />\n&nbsp;</p>\n\n<p>其实很简单，包含Ckeditor的js文件，生成textarea，然后用语句替换。js替换，可以进行更为详细的配置，下文将做详细说明。<br />\n<br />\n<strong>二、Ckeditor工具栏自定义设置</strong></p>\n\n<p>在ckeditor目录下，有个Config.js</p>\n\n<p>未配置的内容如下:</p>\n\n<p>&nbsp;</p>\n\n<p>CKEDITOR.editorConfig = function( config ){// Define changes to default configuration here. For example:// config.language = &#39;fr&#39;;// config.uiColor = &#39;#AADC6E&#39;;</p>\n\n<p>//可以在此处进行配置，配置后调用后就能呈现相应的显示效果，详细内容如下。};</p>\n\n<p><br />\n1.在Ckeditor根目录的config.js中设置：</p>\n\n<ol>\n	<li>config.toolbar = &#39;Full&#39;;</li>\n	<li>config.toolbar_Full =</li>\n	<li>[</li>\n	<li>[&#39;Source&#39;,&#39;-&#39;,&#39;Save&#39;,&#39;NewPage&#39;,&#39;Preview&#39;,&#39;-&#39;,&#39;Templates&#39;],</li>\n	<li>[&#39;Cut&#39;,&#39;Copy&#39;,&#39;Paste&#39;,&#39;PasteText&#39;,&#39;PasteFromWord&#39;,&#39;-&#39;,&#39;Print&#39;, &#39;SpellChecker&#39;, &#39;Scayt&#39;],</li>\n	<li>[&#39;Undo&#39;,&#39;Redo&#39;,&#39;-&#39;,&#39;Find&#39;,&#39;Replace&#39;,&#39;-&#39;,&#39;SelectAll&#39;,&#39;RemoveFormat&#39;],</li>\n	<li>[&#39;Form&#39;, &#39;Checkbox&#39;, &#39;Radio&#39;, &#39;TextField&#39;, &#39;Textarea&#39;, &#39;Select&#39;, &#39;Button&#39;, &#39;ImageButton&#39;, &#39;HiddenField&#39;],</li>\n	<li>&#39;/&#39;,</li>\n	<li>[&#39;Bold&#39;,&#39;Italic&#39;,&#39;Underline&#39;,&#39;Strike&#39;,&#39;-&#39;,&#39;Subscript&#39;,&#39;Superscript&#39;],</li>\n	<li>[&#39;NumberedList&#39;,&#39;BulletedList&#39;,&#39;-&#39;,&#39;Outdent&#39;,&#39;Indent&#39;,&#39;Blockquote&#39;],</li>\n	<li>[&#39;JustifyLeft&#39;,&#39;JustifyCenter&#39;,&#39;JustifyRight&#39;,&#39;JustifyBlock&#39;],</li>\n	<li>[&#39;Link&#39;,&#39;Unlink&#39;,&#39;Anchor&#39;],</li>\n	<li>[&#39;Image&#39;,&#39;Flash&#39;,&#39;Table&#39;,&#39;HorizontalRule&#39;,&#39;Smiley&#39;,&#39;SpecialChar&#39;,&#39;PageBreak&#39;],</li>\n	<li>&#39;/&#39;,</li>\n	<li>[&#39;Styles&#39;,&#39;Format&#39;,&#39;Font&#39;,&#39;FontSize&#39;],</li>\n	<li>[&#39;TextColor&#39;,&#39;BGColor&#39;],</li>\n	<li>[&#39;Maximize&#39;, &#39;ShowBlocks&#39;,&#39;-&#39;,&#39;About&#39;]</li>\n	<li>];</li>\n	<li>&nbsp;</li>\n	<li>config.toolbar_Basic =</li>\n	<li>[</li>\n	<li>[&#39;Bold&#39;, &#39;Italic&#39;, &#39;-&#39;, &#39;NumberedList&#39;, &#39;BulletedList&#39;, &#39;-&#39;, &#39;Link&#39;, &#39;Unlink&#39;,&#39;-&#39;,&#39;About&#39;]</li>\n	<li>];</li>\n</ol>\n\n<p>上述代码中第一行，即为设定默认工具栏的，可以改写为：</p>\n\n<ol>\n	<li>config.toolbar = &#39;Basic&#39;;</li>\n</ol>\n\n<p>2.在用js代码调用Ckeditor时设置：</p>\n\n<ol>\n	<li>CKEDITOR.replace( &#39;editor1&#39;,</li>\n	<li>{</li>\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; toolbar :</li>\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; [</li>\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; [&#39;Styles&#39;, &#39;Format&#39;],</li>\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; [&#39;Bold&#39;, &#39;Italic&#39;, &#39;-&#39;, &#39;NumberedList&#39;, &#39;BulletedList&#39;, &#39;-&#39;, &#39;Link&#39;, &#39;-&#39;, &#39;About&#39;]</li>\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ]</li>\n	<li>});</li>\n</ol>\n\n<p>3.以上两种方法的综合：<br />\n在Ckeditor根目录下的config.js文件中设置好多组toolbar，如方法1示<br />\n<br />\n例代码去掉第一行；调用Ckeditor时的代码如下：</p>\n\n<ol>\n	<li>CKEDITOR.replace( &#39;editor1&#39;,</li>\n	<li>{</li>\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; toolbar : &#39;Full&#39;</li>\n	<li>});</li>\n	<li>&nbsp;</li>\n	<li>CKEDITOR.replace( &#39;editor2&#39;,</li>\n	<li>{</li>\n	<li>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; toolbar : &#39;Basic&#39;</li>\n	<li>});</li>\n</ol>\n\n<p>第三种方法比较灵活，可以在不同的页面中设置不同的样式的编辑器。</p>\n\n<p>更详细的设置参数可以参考另一篇帖子：</p>\n', '0000-00-00 00:00:00', '0', null, '0', '1', '0');
COMMIT;

