  `is_auth` smallint(1) NOT NULL DEFAULT '0' COMMENT '是否自动登录',
  `exp` mediumint(8) NOT NULL DEFAULT '0' COMMENT '经验值 ',
  `level` varchar(20) NOT NULL DEFAULT '0' COMMENT '等级',
  `demand_count` mediumint(10) NOT NULL DEFAULT '0' COMMENT '发表供求数',
  `dynamic_count` mediumint(10) NOT NULL DEFAULT '0' COMMENT '发表动态数',
