  `flag` smallint(6) NOT NULL DEFAULT '1' COMMENT '是否可用',
  `register_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `lastlogin_time` timestamp NULL DEFAULT NULL COMMENT '最后登录时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '最后修改时间',
  `kjt_tonken` varchar(32) DEFAULT NULL COMMENT 'token',
  `password` varchar(32) NOT NULL DEFAULT 'e10adc3949ba59abbe56e057f20f883e' COMMENT '密码(默认123456)',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `username_index` (`username`),
  UNIQUE KEY `mobile_index` (`mobile`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;
delimiter ;;
CREATE TRIGGER `user_insert_after` AFTER INSERT ON `user_account` FOR EACH ROW BEGIN

insert INTO user_evendata (uid,nickname,avatar,product,contact,level_number) VALUES (new.uid,new.nickname,new.avatar,new.product,new.contact,new.level_number);

END;
 ;;
delimiter ;
