update user_evendata set  user_evendata.nickname = new.nickname,user_evendata.avatar=new.avatar,user_evendata.product=new.product,user_evendata.contact=new.contact,user_evendata.level_number=new.level_number where user_evendata.uid=new.uid;

END;
 ;;
